import React from "react";

export default class Task extends React.Component {
  render() {
    return (
      <div className="formContainer">
        <h1>Add a Task!</h1>
        <form>
          <input
            className="inputField"
            action="post"
            placeholder="Task Details"
          />
          <button className="addButton">ADD</button>
        </form>
      </div>
    );
  }
}
